import React from 'react';
import FilterPanel from './FilterPanel.jsx';
import VolumePanel from './VolumePanel';
// Later: import OscillatorPanel, EnvelopePanel, etc.

const Panel = () => {
  return (
    <group>
      {/* Filter controls */}
      <group position={[-6, 0, 0]}>
        <FilterPanel />
      </group>

      {/* Volume controls */}
      <group position={[0, 0, 0]}>
        <VolumePanel />
      </group>

      {/* Future panels */}
      {/* <group position={[6, 0, 0]}> <OscillatorPanel /> </group> */}
    </group>
  );
};

export default Panel;
